    private static final SoundEvent[] VALUES = values();

    @NotNull
    private final NamespaceID id;

    SoundEvent(@NotNull NamespaceID id) {
        this.id = id;
        Registries.soundEvents.put(id, this);
    }

    @Override
    @NotNull
    public Key key() {
        return this.id;
    }

    public short getId() {
        return (short) ordinal();
    }

    @NotNull
    public NamespaceID getNamespaceID() {
        return this.id;
    }

    @Nullable
    public static SoundEvent fromId(short id) {
        if(id >= 0 && id < VALUES.length) {
            return VALUES[id];
        }
        return null;
    }

    @NotNull
    @Override
    public String toString() {
        return "[" + this.id + "]";
    }
